query:
query CustomEmojis($after: String, $first: Int = 200) {
  customEmojis(after: $after, first: $first) {
    edges {
      node {
        ...CustomEmojiFields
        __typename
      }
      __typename
    }
    __typename
  }
}

fragment CustomEmojiFields on CustomEmoji {
  id
  createdAt
  imageURL
  name
  workspaceID
  createdBy {
    ...UserFields
    __typename
  }
  __typename
}

fragment UserFields on User {
  ...UserCommonFields
  workspaceProfiles {
    ...WorkspaceProfileFields
    __typename
  }
  __typename
}

fragment UserCommonFields on User {
  id
  addressDomains
  avatarURL
  bio
  isRegistered
  name
  workspaceIDs
  __typename
}

fragment WorkspaceProfileFields on WorkspaceProfile {
  id
  workspace {
    ... on WorkspacePreview {
      ...WorkspacePreviewSimpleFields
      __typename
    }
    __typename
  }
  slackUser {
    ...SlackUserFields
    __typename
  }
  __typename
}

fragment WorkspacePreviewSimpleFields on WorkspacePreview {
  ...WorkspacePreviewCommonFields
  __typename
}

fragment WorkspacePreviewCommonFields on WorkspacePreview {
  id
  name
  domains
  avatarURL
  joinableBy
  memberCount
  __typename
}

fragment SlackUserFields on SlackUser {
  id
  profileURL
  teamID
  __typename
}
